                                   0.6207049020675687])
    cub_degree = 6
  elseif q <= 7
    # P4; 8th order cubature
    cub = SymCubatures.TriSymCub{T}(vertices=false, numS21=3, numS111=1)
    SymCubatures.setweights!(cub, T[0.045386157905236965;
