    #                                0.353676230440559;
    #                                0.8037465193903021;
    #                                0.4612850345245523;
    #                                0.06105167151116454])
    cub_degree = 8
    tol = 6e-14
  else
    error("polynomial degree must be <= 8 (presently)\n")
  end
  mask = 1:(cub.numparams+cub.numweights)
  vtx = T[-1 -1; 1 -1; -1 1]
  Cubature.solvecubaturelma!(cub, cub_degree, mask, tol=tol)
