"""
### Cubature.getTriCubatureDiagELineLGL{T}

Returns a cubature rule and vertices for the Line-LGL SBP DiagE operators 
on triangles; these are cubatures that have nodes on the boundary that 
correspond with LGL quadrature rules, which then leads to diagonal E.

**Inputs**

* `q`: maximum degree of polynomial for which the cubature is exact
* `T`: the data type used to represent the cubature
* `tol`: tolerance with which to solve the cubature

**Outputs**

* `cub`: a symmetric cubature for the right triangle
* `vtx`: vertices for the right triangle
"""
function getTriCubatureDiagELineLGL(q::Int, T=Float64; tol=10*eps(typeof(real(one(T)))))
  cub_degree = q
  mask = zeros(Int64, (0))
  
  ne = convert(Int64,ceil((q+mod(q,2)+3)/2))
  midedges = centroid = mod(ne,2)
  numedge = div(ne-2-midedges,2)
  cub = SymCubatures.TriSymCub{T}(vertices=true,
                                  midedges=Bool(midedges),
                                  numS21=(midedges+1)*numedge,
                                  numedge=numedge,
                                  numS111=div((numedge+1)^2 - (3*numedge+1),2),
                                  centroid = Bool(centroid))
  if q<=2 
    SymCubatures.setweights!(cub, T[0.04761904761904726, 0.47619047619047483, 0.4285714285714286])
