"""
### Cubature.getTriCubatureOmegaLineLG{T}

Returns a cubature rule and vertices for the SBP Omega operators 
on triangles; these are cubatures derived by using tensor-product
of half of the nodes in the LG quadrature rules.

**Inputs**

* `q`: maximum degree of polynomial for which the cubature is exact
* `T`: the data type used to represent the cubature
* `tol`: tolerance with which to solve the cubature

**Outputs**

* `cub`: a symmetric cubature for the right triangle
* `vtx`: vertices for the right triangle
"""
function getTriCubatureOmegaLineLG(q::Int, T=Float64; tol=10*eps(typeof(real(one(T)))))
  # @assert(mod(q,2)==0, "Quadrature degree must be even.")

  # cub_degree = q
  # mask = zeros(Int64, (0))
  # p=convert(Int, floor((q+1)/2))
  # ne = p+1
  # numedge = convert(Int,(ne-mod(ne,2))/2)
  
  cub_degree = q
  mask = zeros(Int64, (0))
  if q<=30 
    if mod(q,2)==0 && mod(q-1,4)!=0
      ne = convert(Int,q/2) + 1
    elseif mod(q-1,4)==0
      ne = convert(Int,ceil(q/2))
    else
      ne = convert(Int,ceil(q/2))+1
    end
  else
    if mod(q,2)==0
      ne = convert(Int, q/2)+1
    else
      ne = convert(Int,ceil(q/2))
    end
  end

  numedge = convert(Int,(ne-mod(ne,2))/2)
  cub = SymCubatures.TriSymCub{T}(vertices=false,
                                  midedges=false,
                                  numS21=convert(Int,(1+mod(ne,2))*numedge),
                                  numedge=0,
                                  numS111=convert(Int,1/2*(numedge^2 - numedge)),
                                  centroid = convert(Bool,mod(ne,2)))
  if q <=1 # 3 nodes
    SymCubatures.setweights!(cub, T[2.0])
    cub_degree = 1
    tol = 5e-14
